import { React, useEffect, useState } from "react";
import {
  BrowserRouter as Router,
  Link,
  Route,
  Routes,
  useParams,
} from "react-router-dom";
import "./Courses.css";
import Navbar from "../Navbar";
import { getCourses } from "../Backend/firebase-functions";

function Courses() {
  const [courses, setCourses] = useState([]);
  const [loading, setLoading] = useState(true);

  const { id, catId } = useParams();
  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const data = await getCourses(id, catId);
      setCourses(data);
      setLoading(false);
    } catch (error) {
      console.log(error);
    }
  };

  // const content = courses.map((post) => (
  //   <Link id="link" to={``}>
  //     <div className="courseBox" key={post.name}>
  //       <h3>{post.name}</h3>
  //     </div>
  //   </Link>
  // ));

  if (loading) {
    return <h1>Loading...</h1>;
  } else {
    return (
      <div>
        <Navbar />
        <div className="courses">
          <h1 className="listTitle">
            <strong>{catId} </strong> courses at{" "}
            <strong>Stevens Institute of Technology</strong>
          </h1>
          <div className="courseComponent">Hi</div>
        </div>
      </div>
    );
  }
}

export default Courses;
